import React from 'react'
import Axios from 'axios'

function Test() {
  Axios.get("http://45.77.232.166:8080/get-pcos").then(response =>
  response.json())
  .then(response => {
      console.log(response)
      var dat = response.data;
      console.log(dat);
      var pCos = []
      pCos.push(dat[0])
      alert(pCos[0].name);
  })


  

  return(
    <div>
      <button>Get Info</button>
      
    </div>
  );
}

export default Test;
